import React from 'react';
import '../../../App.css'
import PatientsList from '../../components/Patients/PatientsList.js';
import PatientsSlideShow from '../../components/Patients/PatientsSlideShow.js';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';



// functional porque redux maneja el state
const PatientsMain = () => (
  <div className='patientsMainContainer'>
      <Grid container spacing={12}>
        <Grid item xs={8}>
            <PatientsList/>

        </Grid>

        <Grid item xs={4}>
          <div>
            <Paper>
              <PatientsSlideShow/>
            </Paper>
          </div>
        </Grid>  

      </Grid>
  </div>
);

export default PatientsMain;
